import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
          <Grid>
            <Row className="show-grid">
              <Col xs={12} md={8}>ApeGang</Col>
              <Col xs={6} md={4}>
                <code>{'<Col xs={6} md={4} />'}</code>
              </Col>
            </Row>
          </Grid>
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    );
  }
}

export default App;
